import React from 'react'
import styled from 'styled-components'

const StyledButton = styled.div`

`;

function Button({buttonDisplayName, handleClick}) {
  return (
    <StyledButton>
      <button 
        onClick={handleClick}
      >
        {buttonDisplayName}
      </button>
    </StyledButton>
  )
}

export default Button
